from flask_restplus import fields

from wonderline_app.api.namespaces import users_namespace

user_sign_up_model = users_namespace.model("UserSignUp", {
    "email": fields.String(example="jon@gmail.com", required=True),
    "uniqueName": fields.String(example="jon_snow", required=True),
    "password": fields.String(example="password", required=True),
    "photoData": fields.String(
        example="",
        required=False),
})

user_sign_in_model = users_namespace.model("UserSignIn", {
    "email": fields.String(example="jon@gmail.com", required=True),
    "password": fields.String(example="password", required=True)
})
